import React from 'react';
import MyButton from '../button/myButton';
import { Link } from "react-router-dom";

const Nav = () => {
    return (
        <div>
      <MyButton>
        <Link to="/Profile" style={{ textDecoration: "none", color: "black" }}>
          edit profil
        </Link>
      </MyButton>
      <MyButton>
        <Link to="/Regpage" style={{ textDecoration: "none", color: "black" }}>
          log out
        </Link>
      </MyButton>
        </div>
    );
};

export default Nav;
